        public bool Merge( BaseDataGuid<Kind> dataObject )
        {
            bool result = false;
            var objectState = dataObject.ObjectState;
            switch ( objectState )
            {
                case ObjectState.New:
                {
                    result = Insert( dataObject );
                }
                break;
                case ObjectState.Changed:
                {
                    result = Update( dataObject );
                }
                break;
                case ObjectState.Deleted:
                {
                    result = Delete( dataObject );
                }
                break;
            }
            return result;
        }

